import SearchBar from "./SearchBar.jsx"
import React from "react"
import { Link } from "react-router-dom"

class Nav extends React.Component {
    constructor(props){
        super()
    }

    render(){
        return <nav>
        <SearchBar onSearch={this.props.onSearch}/>
        </nav>
    }
}

export default Nav;
